import { InnerPagesTopTitle } from "../../../../../common/InnerPagesTopTitle/InnerPagesTopTitle";
import { NavLink } from "react-router-dom";
import "jquery/dist/jquery.min.js";
import "datatables.net-dt/js/dataTables.dataTables";
import "datatables.net-dt/css/jquery.dataTables.min.css";
import $ from "jquery";
import { MdOutlineModeEditOutline } from "react-icons/md";
import { AiOutlinePlusCircle, AiOutlineDelete } from "react-icons/ai";
import { useState } from "react";
import React, { useEffect } from "react";
import { OutlineLinkBtn, BlueBtn } from "../../../../../common/btn/Btn";
import { SideLabelInput } from "../../../../../common/InputField/Form";

import { useNavigate } from "react-router-dom";

export const Receptions = () => {
  return (
    <>
      <div className="custom_container">
        <div className="inner_custom_container">
          <div className="user_managemen_top_title">
            <InnerPagesTopTitle name="User Management" />
          </div>

          <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
            <div className="col-12">
              <PageTopNav />
            </div>
            <div className="col-12">
              <PageTopBtn />
            </div>
            <div className="col-12">
              <div className="table_main_div">
                <MyTabel />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

const PageTopNav = () => {
  const PageTopNavListData = [
    {
      backgroundColor: "white",
      color: "black",
      name: "Customers",
      link: "/max/Customer",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Employees",
      link: "/max/employees",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Sub-contractor",
      link: "/max/sub_contractors",
    },
    {
      backgroundColor: "#3499ff",
      color: "white",
      name: "Receptions",
      link: "/max/receptions",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Receptions",
      link: "/max/refereers",
    },
  ];
  const PageTopNavListApp = (props) => {
    return (
      <NavLink to={props.link}>
        <div
          style={{
            backgroundColor: props.backgroundColor,
            color: props.color,
          }}
          className=" page_top_nav_link"
        >
          {props.name}
        </div>
      </NavLink>
    );
  };
  return (
    <>
      <div className="page_top_nav_div_top">
        <div className="page_top_nav">
          {PageTopNavListData.map((val, i) => {
            return <PageTopNavListApp key={i} {...val} />;
          })}
        </div>
      </div>
    </>
  );
};
export const PageTopBtn = () => {
  return (
    <>
      <div className="row g-3">
        <div className="col-xxl-5 col-xl-5 col-lg-6 col-md-7 col-sm-12 col-12">
          <div className="row g-3">
            <div className="col-xxl-6 col-xl-6 col-lg-6 col-md-6 col-sm-12 col-sm-12">
              <div>
                <OutlineLinkBtn
                  icon={<AiOutlinePlusCircle />}
                  title="Add new Reception"
                  link="/max/add_new_reception"
                />
              </div>
            </div>
            <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
              <div>
                <BlueBtn title="Excel" />
              </div>
            </div>
            <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
              <div>
                <BlueBtn title="Print" />
              </div>
            </div>
          </div>
        </div>
        <div className="col-xxl-7 col-xl-7 col-lg-6 col-md-5 col-sm-12 col-12">
          <div className="row g-3">
            <div className="col-xxl-6 col-xl-6 col-lg-6 col-md-12 col-sm-12 col-12">
              <div className=" d-flex justify-content-end">
                <SideLabelInput label="start date" type="date" />
              </div>
            </div>
            <div className="col-6 col-xxl-6 col-xl-6 col-lg-6 col-md-12 col-sm-12 col-12">
              <div className=" d-flex justify-content-end">
                <SideLabelInput label="end date" type="date" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
const MyTabel = () => {
  const navigate = useNavigate();
  const [isTableLoaded, setIsTableLoaded] = useState(false);
  useEffect(() => {
    if (!isTableLoaded) {
      setTimeout(() => {
        setIsTableLoaded(true);
        $("#Customer_table").DataTable({
          responsive: true,
          deferRender: true,
          scroller: true,
          // bLengthChange: false,
        });
      }, 1000);
    }
  });
  const ListData = [
    {
      ReceptionID: "MMCR111",
      date: "22-02-22",
      Name: "Lauren Scott",
      Username: "Lauren",
      EmailId: "lauren@gmail.com",
      PhoneNumber: "Lauren",
      editLink: "/max/edit_new_reception",
    },
  ];
  const ListApp = (props) => {
    return (
      <tr>
        <td>{props.ReceptionID}</td>
        <td>{props.date}</td>
        <td>{props.Name}</td>
        <td>{props.Username}</td>
        <td>{props.EmailId}</td>
        <td>{props.EmailId}</td>
        <td>{props.Status}</td>
        <td>{props.Phone}</td>
        <td>
          <div
            onClick={() => navigate(props.editLink)}
            className="tabel_td_inner"
          >
            <MdOutlineModeEditOutline />
          </div>
        </td>
